  [],\n\t\"revision_timestamp\": \"2016-08-04T08:18:13.537921\",\n\t\"name\": \"kenai-national-wildlife-refuge-annual-narrative-report-calendar-year-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kenai
  NWR outlines Refuge accomplishments during the 1988 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, volunteer programs, funding, and safety
  is given. Habitat management is also covered; subjects include forests, fire management,
  pest control, and wilderness areas. The wildlife section of the report discusses
  waterfowl, raptors, game mammals, fisheries resources, and marking and bird banding.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
  recreation, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  equipment replacement, communication systems, computer systems, and energy conservation.
  Economic uses of the Refuge and items of interest are provided at the end.\",\n\t\"license_title\":
